import React from "react";
import Container from "react-bootstrap/Container";
import ContentForm from "../form/ContentForm";
import PageHeading from "../headings/PageHeading";
import Col from "react-bootstrap/Col";
import CardParagraph from "../cards/CardParagraph";
import Row from "react-bootstrap/Row";
import { FaPhoneAlt, FaRegEnvelope, FaMapMarkerAlt } from "react-icons/fa";

function Contact() {
  return (
    <>
      <Container>
        <Row>
          <Col lg={12} lg={{ order: "first" }} xs={12}>
            <Container>
              <PageHeading content="Submit your details" />
            </Container>
          </Col>

          <Col md={6} xs={12} xs={{ order: "last" }} md={{ order: "first" }}>
            <ContentForm />
          </Col>
          <Col md={6} xs={12} xs={{ order: "first" }}>
            <Container>
              <ul>
                <li>
                  <FaPhoneAlt />
                  <CardParagraph content="hello@yay.com" />
                </li>
                <li>
                  <FaRegEnvelope />
                  <CardParagraph content="123 456 7890" />
                </li>
                <li>
                  <FaMapMarkerAlt />
                  <CardParagraph content="Address" />
                </li>
              </ul>
            </Container>
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default Contact;
